import React, { Component, Fragment } from 'react'
import Nav from '../components/nav.jsx';
import Header from '../components/welcoming/header';
import Services from '../components/welcoming/services.jsx';
import Achievements from '../components/welcoming/achievements.jsx';

class HomePage extends Component {
  render() {
    return (
      <Fragment>
        <Nav />
        <section>
        <Header />
        </section>
        <section>
        <Services />
        </section>
        <section>
        <Achievements />
        </section>
        <section>
        <About />
        </section>
      </Fragment>
    )
  }
}

export default HomePage
